import logo from "./logo.svg";
import "./App.css";
import { render, useState } from "@testing-library/react";

const rows = 3;

function onClickListener() {
  return <h1>Clicked</h1>;
}

function Square({ value }) {
  return (
    <button className="square" onClick={onClickListener()}>
      {value}
    </button>
  );
}

export default function Board() {
  return Array(rows).fill(
    <div className="board-row">
      {Array(rows)
        .fill()
        .map((v, i) => (
          <Square value={i + 1}></Square>
        ))}
    </div>
  );
}

